import React from 'react';
import { ChakraProvider } from '@chakra-ui/react';
import { BrowserRouter as Router } from 'react-router-dom';
import MainPage from './MainPage';

const App = () => {
  return (
    <ChakraProvider>
      <Router>
        <MainPage />
      </Router>
    </ChakraProvider>
  );
};

export default App;
